const request = require("supertest");
const app = require("../app");
const {
    product
} = require("../models");

// truncate all existing 
product.destroy({ truncate: true, restartIdentity: true });

let productId;

// add new product API = POST/api/product
// test add new product
test('Should add a new product', async () => {
    const productTest = await request(app)
        .post('/api/product')
        .send({
            "name": "Ultra Milk",
            "qty": 25,
            "picture": "data:image/jpeg;base64,",
            "expiredAt": "2023-01-01"
        })
        .expect(200);
    productId = productTest.body.data.id;
});

// get all product API = GET/api/product
// test get all products
test('Should get all products', async () => {
    await request(app)
        .get('/api/product')
        .send()
        .expect(200);
});

// get product by Id API = GET/api/product/:id
// test get product by id
test('Should get product for existed id', async () => {
    await request(app)
        .get(`/api/product/${productId}`)
        .send()
        .expect(200);
});

// test get product by id not found
test('Should not get product for not existed id', async () => {
    await request(app)
        .get(`/api/product/${productId+1}`)
        .send()
        .expect(404);
});

// update product API = PUT/api/product/:id
// test update product
test('Should update product and the qty equal to 10', async () => {
    const productTest = await request(app)
        .put(`/api/product/${productId}`)
        .send({
            "name": "Ultra Milk",
            "qty": 10,
            "picture": "data:image/jpeg;base64,",
            "expiredAt": "2023-01-01"
        })
        .expect(200);
    await expect(productTest.body.data.qty).toBe(10);
});

// test update product not found
test('Should not update product for not existed id', async () => {
    const productTest = await request(app)
        .put(`/api/product/${productId+1}`)
        .send({
            "name": "Ultra Milk",
            "qty": 10,
            "picture": "data:image/jpeg;base64,",
            "expiredAt": "2023-01-01"
        })
        .expect(404);
});

// delete product API = DELETE/api/product/:id
// test delete product by id
test('Should delete product for existed id by changing isActive to false', async () => {
    const productTest = await request(app)
        .delete(`/api/product/${productId}`)
        .send()
        .expect(200);
    await expect(productTest.body.data.isActive).toBe(false);
});

// test delete product for id not found
test('Should not delete product for not existed id', async () => {
    await request(app)
        .delete(`/api/product/${productId+1}`)
        .send()
        .expect(404);
});